@import url('https://fonts.googleapis.com/css?family=Roboto&display=swap');

*{
    font-family: 'Roboto', sans-serif;
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

div.authentication-div {
    margin: 20px auto;
    padding: 30px;
    text-align: center;
    background: #e8e8e8;
    width: 95%;
    max-width: 400px;
    border-radius: 12px;

    .error{
        color: rgba(223, 16, 16, 0.712);
        font-size: 10pt;
        font-family: Arial, Helvetica, sans-serif;
    }

    input{
        padding: 5px;
        margin: 10px;
        border-radius: 4px;
        border: none;

        &:focus {
            outline:none;
            border: 2px solid rgba(2, 105, 90, 50%)
        }
    }

    label.input-label{
        display: block;
        margin-top: 20px;
    }
    button{
        padding: 8px 25px;
        margin: 10px auto;
        display: block;
        border: none;
        border-radius: 5px;
        background-color: aquamarine;
        color: black;
        font-weight: bold;
        font-size: 10pt;
        &:focus {
            background-color: rgba(2, 216, 20, 0.699)
        }
    }
}

div.home-div{
    div.button-container{
        padding: 30px;
        width: 95%;
        margin: 25px auto;
        max-width: 500px;
        display: flex;
        flex-direction: row;
        background-color: #e8e8e8;
        border-radius: 20px;
        justify-content: space-around;

        button{
            cursor: pointer;
            padding: 15px 25px;
            background-color: #18aeff;
            border-radius: 8px;
            border: none;
            color: white ;
        }
    }
    div.auth-text{
        padding: 30px;
        width: 95%;
        margin: 25px auto;
        max-width: 500px;
        background-color: #e8e8e8;
        border-radius: 20px;

        button{
            cursor: pointer;
            display: block;
            margin: 15px auto;
            width: 40%;
            padding: 10px 20px;
            background-color: #18aeff;
            border-radius: 6px;
            border: none;
            color: white ;
        }
    }
}
